import React, { useState } from 'react'
import Table from '../../TestComponents/Table';
import Chart from '../../TestComponents/Chart';
import { useEffect } from 'react';

function ManualDatasetUpload({DataSet, noOfSpecimens, x_axis, y_axis}) {
    const [x_axisValue, setX_axisValue] = useState([])
    const [y_axisValue, setY_axisValue] = useState([])
    
    const [data, setData] = useState([{
        dataset:0,
        specimens:0,
        x_axis:{
            name:"",
            units:"",
            value:[]
        },
        y_axis:{
            name:"",
            units:"",
            value:[]
        }
    }])

    const handleXAxisUpdate = async(newXAxisValues) => {
        setX_axisValue(newXAxisValues);
    };
    
    const handleYAxisUpdate = async(newYAxisValues) => {
        setY_axisValue(newYAxisValues);
    };

    const updateManualDataSet = async() => {
        await setData((prevData) => [{
            dataset:DataSet,
            specimens:noOfSpecimens,
            x_axis:{
                name:x_axis,
                units:"",
                value:x_axisValue
            },
            y_axis:{
                name:y_axis,
                units:"",
                value:y_axisValue
            }
            } 
        ]);
    };
      
    useEffect(() => {
        console.log("Meowowwo")
        updateManualDataSet()
    }, [handleXAxisUpdate.length])

    const specimensInput = (index) => {
        const InputTags = []
        var j=1;
        for(let i=0; i<noOfSpecimens; i++){
          InputTags.push(
            <div className="upload_data_section">
                {
                  <div className="upload_data_table">
                    <h3>
                      Specimen {j}
                    </h3>
                    <Table
                        sno={j} index={index} 
                        y_axis={y_axis} 
                        x_axis={x_axis}
                        handleXAxisUpdate={handleXAxisUpdate}
                        handleYAxisUpdate={handleYAxisUpdate}
                    />
                  </div>
                }
            </div>
          )
          j=j+1;
        }
        return InputTags
    }

    // useEffect(() => {
    //     console.log("Data", data)
    // }, [data])
  return (
    <div className="upload_data_wrapper">
        <div className="upload_data_container">
            <div className="upload_container_header">
                  <h4><p>ManualDatasetUpload {DataSet+1} : {noOfSpecimens}</p></h4>
            </div>
            <div className="upload_data_wrapper">
            {
                specimensInput()
            }
            </div>
            <Chart />
        </div>
    </div>
  )
}

export default ManualDatasetUpload
